// src/components/Navbar.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Button,
  Menu,
  MenuItem,
  Box,
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';

// Styled Components for Enhanced Styling
const StyledAppBar = styled(AppBar)`
  background-color: #0e0f31;
  box-shadow: none;
  padding: 0 10%;
  position: fixed;
  top: 0;
  z-index: 1000;
  height: 80px;

  @media (max-width: 960px) {
    padding: 0 5%;
  }
`;

const Logo = styled(Typography)`
  flex-grow: 1;
  text-decoration: none;
  color: #ffffff;
  font-weight: bold;
  font-size: 2rem; /* Increased Font Size */
  display: flex;
  align-items: center;

  img {
    width: 45px; /* Increased Logo Size */
    height: 40px;
    margin-right: 12px;
  }

  @media (max-width: 600px) {
    font-size: 1.8rem;
    img {
      width: 35px;
      height: 30px;
      margin-right: 8px;
    }
  }
`;

const NavLinks = styled(Box)`
  display: flex;
  align-items: center;
  justify-content: flex-end;
  flex-grow: 1;

  a {
    color: #ffffff;
    text-decoration: none;
    margin-left: 20px;
    font-size: 1.2rem; /* Increased Font Size */
    font-weight: 500;
    transition: color 0.3s ease, transform 0.3s ease;

    &:hover {
      color: #ffae00;
      transform: translateY(-3px);
    }

    @media (max-width: 960px) {
      margin-left: 15px;
      font-size: 1rem;
    }
  }
`;

const StyledButton = styled(Button)`
  color: #ffffff;
  margin-left: 20px;
  font-size: 1.2rem; /* Increased Font Size */
  font-weight: 500;
  text-transform: none;
  transition: background-color 0.3s ease, transform 0.3s ease;

  &:hover {
    background-color: #ffae00;
    color: #0e0f31;
    transform: scale(1.05);
  }

  @media (max-width: 960px) {
    margin-left: 15px;
    font-size: 1rem;
  }
`;

// Mobile Menu Button Styling
const MobileMenuButton = styled(IconButton)`
  color: #ffffff;
`;

// Mobile Menu Styling
const MobileMenu = styled(Menu)`
  & .MuiPaper-root {
    background-color: #0e0f31;
    color: #ffffff;
    width: 200px;
    border-radius: 8px;
  }

  & .MuiMenuItem-root {
    font-size: 1.1rem;
    transition: background-color 0.3s ease, transform 0.3s ease;

    &:hover {
      background-color: #ffae00;
      color: #0e0f31;
      transform: scale(1.02);
    }
  }
`;

const Navbar = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  // Handle Opening of Mobile Menu
  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  // Handle Closing of Mobile Menu
  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <StyledAppBar position="fixed">
      <Toolbar disableGutters>
        {/* Logo */}
        <Logo component={Link} to="/">
          <img src="/Logo.png" alt="Logo" /> {/* Replace with your logo path */}

        </Logo>

        {/* Desktop Navigation Links */}
        <NavLinks sx={{ display: { xs: 'none', md: 'flex' } }}>
          <Link to="/">Home</Link>
          <Link to="/about">About Us</Link>
          <Link to="/learn-more">Learn More</Link>
          <Link to="/contact">Contact Us</Link>
          <StyledButton component={Link} to="/testing-login">
            Login
          </StyledButton>
        </NavLinks>

        {/* Mobile Navigation Menu */}
        <Box sx={{ display: { xs: 'flex', md: 'none' }, alignItems: 'center' }}>
          <MobileMenuButton
            size="large"
            edge="end"
            aria-label="menu"
            onClick={handleMenuOpen}
          >
            {anchorEl ? <CloseIcon /> : <MenuIcon />}
          </MobileMenuButton>
          <MobileMenu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
            anchorOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
          >
            <MenuItem component={Link} to="/" onClick={handleMenuClose}>
              Home
            </MenuItem>
            <MenuItem component={Link} to="/about" onClick={handleMenuClose}>
              About Us
            </MenuItem>
            <MenuItem
              component={Link}
              to="/learn-more"
              onClick={handleMenuClose}
            >
              Learn More
            </MenuItem>
            <MenuItem
              component={Link}
              to="/contact"
              onClick={handleMenuClose}
            >
              Contact Us
            </MenuItem>
            <MenuItem
              component={Link}
              to="/testing-login"
              onClick={handleMenuClose}
            >
              Login
            </MenuItem>
          </MobileMenu>
        </Box>
      </Toolbar>
    </StyledAppBar>
  );
};

export default Navbar;
